import { Layout, theme } from "antd";

import React from "react";
const AppContent = () => {
  const { Content } = Layout;

  const {
    token: { colorBgContainer },
  } = theme.useToken();
  return (
    <div>
      <Content
        style={{
          margin: "24px 16px",
          padding: 24,
          minHeight: 280,
          background: colorBgContainer,
        }}
      >
        Content
      </Content>
    </div>
  );
};

export default AppContent;
